---
name: NXP MIMXRT1050 Series (Rev B)
manufacturer: ~
variants:
  - name: MIMXRT1050_hyperflash
    part: ~
    cores:
      - name: main
        type: armv7em
        core_access_options:
          !Arm
            ap: 0
            psel: 0
    memory_map:
      - !Nvm
          name: FlexSPI
          range:
            start: 0x60000000
            end:   0x64000000
          is_boot_memory: true
          cores:
            - main
      - !Ram
          name: OCRAM
          range:
            start: 0x20200000
            end:   0x20240000
          is_boot_memory: false
          cores:
            - main
    flash_algorithms:
      - mimxrt105x_hyper_256kb_sec
  - name: MIMXRT1050_quadspi
    part: ~
    cores:
      - name: main
        type: armv7em
        core_access_options:
          !Arm
            ap: 0
            psel: 0
    memory_map:
      - !Nvm
          name: FlexSPI
          range:
            start: 0x60000000
            end:   0x60800000
          is_boot_memory: true
          cores:
            - main
      - !Ram
          name: OCRAM
          range:
            start: 0x20200000
            end:   0x20240000
          is_boot_memory: false
          cores:
            - main
    flash_algorithms:
      - mimxrt105x_quadspi_4kb_sec
flash_algorithms:
  - name: mimxrt105x_hyper_256kb_sec
    description: MIMXRT105x 64mB Hyper Flash
    default: true
    instructions: 
    load_address: ~
    pc_init: 113
    pc_uninit: 221
    pc_program_page: 275
    pc_erase_sector: 245
    pc_erase_all: 225
    data_section_offset: 15068
    flash_properties:
      address_range:
        start: 0x60000000
        end:   0x64000000
      page_size: 512
      erased_byte_value: 255
      program_page_timeout: 100
      erase_sector_timeout: 5000
      sectors:
        - size: 262144
          address: 0
    cores: [ main ]
  - name: mimxrt105x_quadspi_4kb_sec
    description: MIMXRT105x 8mB QuadSPI NOR Flash
    default: false
    instructions: 
    load_address: ~
    pc_init: 113
    pc_uninit: 221
    pc_program_page: 275
    pc_erase_sector: 245
    pc_erase_all: 225
    data_section_offset: 14952
    flash_properties:
      address_range:
        start: 0x60000000
        end:   0x60800000
      page_size: 256
      erased_byte_value: 255
      program_page_timeout: 100
      erase_sector_timeout: 5000
      sectors:
        - size: 4096
          address: 0
    cores: [ main ]
